import React from 'react'
import Typography from '@mui/material/Typography';

function Devicestatus() {
  
  var status='Online';
  var statuscolor="green"



  return (
    <div>
      <Typography variant="h6" color={statuscolor}>
         {status}
       </Typography>
    </div>
  )
}

export default Devicestatus
